Security Center at https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability. ','https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability',0,0),(333,4,'2016-11-14 17:38:04','Community Edition 1.9.3.1 is Now Available – 11/14/2016','Community Edition 1.9.3.1 addresses issues encountered by some merchants in our October 12 product releases. All merchants should either upgrade to Community Edition 1.9.3.1 or apply our latest patch, SUPEE-8788, to close several serious security vulnerabilities. More information is available in the release notes at: http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html#ce19-1931 ','http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html#ce19-1931 ',0,0),(334,1,'2017-01-13 23:03:20','New Zend Framework Security Vulnerability – 1/13/2017','We’ve found a new vulnerability in a Zend Framework 1 and 2 email component used by all Magento 1 and Magento 2 software (as well as other PHP solutions). This vulnerability is serious and can lead to a remote code execution attack if your servers use Sendmail as a mail transport agent. Learn how to protect your sites at https://magento.com/security/news/new-zend-framework-1-security-vulnerability\n\n','https://magento.com/security/news/new-zend-framework-1-security-vulnerability',0,0),(335,4,'2017-01-19 13:28:24','New Magento DevBox Beta Speeds Magento 2 Setup – 1/19/2017','Magento DevBox Beta makes it faster and easier than ever to setup your Magento 2 development environment. Read our blog post to find out more at: https://magento.com/blog/technical/set-your-magento-2-development-environment-faster.','https://magento.com/blog/technical/set-your-magento-2-development-environment-faster',0,0),(336,1,'2017-02-07 16:33:15','Community Edition 1.9.3.2 and SUPEE-9652 Resolve Zend Framework Security Issue – 2/7/2017','Community Edition 1.9.3.2 and the SUPEE-9652 patch resolve the recent Zend Framework 1 Security vulnerability. Review the Magento Security Center post for more information:  https://magento.com/security/patches/supee-9652','https://magento.com/security/patches/supee-9652',0,0),(337,4,'2017-02-17 17:37:28','Inspirational athlete, Serena Williams, will join Magento at Imagine 2017.','Imagine 2017 will bring together 3000+ international commerce experts to exchange ideas on the future of commerce. Don’t miss this opportunity to hear from inspirational athlete, Serena Williams, and Stella & Dot CEO, Jessica Herrin. Join us in Las Vegas, April 3-5. Register Now at https://imagine.magento.com/\n','https://imagine.magento.com/',0,0),(338,4,'2008-11-08 01:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.','',0,0),(339,4,'2008-11-08 01:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.','',0,0),(340,4,'2008-11-08 01:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.','',0,0),(341,4,'2008-11-08 01:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.','',0,0),(342,4,'2008-11-08 01:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, et